export default `
@font-face {
  font-family: 'Fraunces';
  font-style: normal;
  font-weight: 400;
  src: url(fonts/Fraunces-Regular.woff2);
  
}

@font-face {
  font-family: 'LibreFranklin';
  font-style: normal;
  font-weight: 400;
  src: url(fonts/LibreFranklin-Regular.ttf);
}

`;
